description:
La Patronne de l'agence immobiliere (NEW 2014 JTC) [DVDRip]

Victoria Blanc, Alyze, Cedric Fato, Josh, Lisa Candy

Tous les moyens sont bons pour cette directrice d'agence immobilire pour parvenir ses fins, se sparer tout prix et surtout un prix trs lev de maisons priori invendables. Mais elle sait y mettre la forme et faire en sorte que chaque visiteur ressorte de la visite des lieux bahi' et si possible la queue bien ponge. Ds lors, lorsqu'on tudie de prs la stratgie perverse entreprise par cette directrice lubrique, on comprend mieux pourquoi les affaires sont si florissantes.

